n.push(A.a(["\uad00\uacc4\ub97c \uc911\uc694\ud558\uac8c \uc0dd\uac01\ud558\ub294 \ud0c0\uc785\uc774\ub77c \uc0c8\ub0b4\uae30 \uc0c8\uc12c \uad00\uacc4\uac00 \uc798 \uc720\uc9c0\ub420 \uc218 \uc788\uac8c \ud558\ub294 \uc5ed\ud560\uc744 \ub2f4\ub2f9\ud560 \uc218 \uc788\uc5b4\uc694. \uad00\uacc4\uc5d0 \ucda9\uc2e4\ud55c \ubcf8\uc778\uc758 \uac15\uc810\uc73c\ub85c \uc0c8\ub0b4\uae30\ub4e4\uc744 \uc798 \ucc59\uae30\ub294 \ud3b8\uc774\uc5d0\uc694.","\uba3c\uc800 \uc11c\uc2b4\uc5c6\uc774 \uc5f0\ub77d\uc744 \uc798\ud558\ub294 \uc131\ud5a5\uc774 \ub204\uad70\uac00\uc5d0\uac8c \uc704\ub85c\uc640 \ud798\uc774 \ub420 \uc218 \uc788\uc5b4\uc694"],s))
n.push(A.a(["\uc5b4\ub290 \uc0c1\ud669\uc5d0\uc11c\ub098 \ubd84\uc704\uae30 \uba54\uc774\ucee4 \uc5ed\ud560\uc744 \ud574\uc11c \uc5b4\uc0c9\ud55c \uc0c8\uc12c \uc0c8\ub0b4\uae30 \uccab \ub9cc\ub0a8\ub54c, \ubd84\uc704\uae30\ub97c \uc8fc\ub3c4\ud558\ub294 \uc5ed\ud560\uc744 \ub2f4\ub2f9\ud560 \uc218 \uc788\uc5b4\uc694","\uc0c8\ub0b4\uae30\ub4e4\uc5d0\uac8c \uce5c\uad6c\uc640 \uac19\uc740 \uc0c8\uc12c\uc774 \ub420 \uc218 \uc788\uc5b4\uc11c \uc0c8\ub0b4\uae30\ub4e4\uacfc \uc27d\uac8c \uce5c\ud574\uc9c8 \uc218 \uc788\uc5b4\uc694"],s))
n.push(A.a(["\uc0c8\uc12c \ud30c\ud2b8\ub108\uc640 \uc0c8\ub0b4\uae30 \uc0ac\uc774\uc5d0\uc11c \ubb38\uc81c\uac00 \uc788\uc744\ub54c, \ud569\ub9ac\uc801\uc73c\ub85c \ud310\ub2e8\ud558\uc5ec \ubb38\uc81c\ub97c \ubc14\ub77c\ubcf4\uace0, \uc911\uc7ac\uc758 \uc5ed\ud560\uc744 \ub2f4\ub2f9\ud560 \uc218 \uc788\uc5b4\uc694."],s))
