n.push(A.a(["\ubb38\uc81c \uc0c1\ud669\uc774\ub098 \uace0\ubbfc\uc744 \ub4e3\uace0, \ub0c9\uc815\ud558\uac8c \ubd84\uc11d\ud574\uc11c \ubb38\uc81c\ud574\uacb0\uc5d0 \ub3c4\uc6c0\uc744 \uc8fc\ub294 \uc870\ub825\uc790 \uc5ed\ud560\uc744 \ud560 \uc218 \uc788\uc5b4\uc694."],s))
