m.push(A.a(["\uc0c8\ub0b4\uae30, \uc0c8\uc12c\ub07c\ub9ac \uc11c\ub85c \uce5c\ud574\uc9c0\uae30 \uc704\ud574 \ub9c8\ub2c8\ub610 \ud65c\ub3d9\uc744 \ud574\ubcf4\uc138\uc694","\uc798 \uc5b4\uc6b8\ub9ac\uc9c0 \ubabb\ud558\ub294 \uc0c8\ub0b4\uae30\uac00 \uc788\ub2e4\uba74, \ub530\ub85c \ubc25\uace0\ub97c \uc7a1\uc544 \uce5c\uad6c\uc640 \uac19\uc740 \uc0c8\uc12c\uc774 \ub418\uc5b4\ubcf4\uc544\uc694"],s))
m.push(A.a(["\uc989\ud765\uc801\uc73c\ub85c \uc0c8\ub0b4\uae30\ub4e4\uacfc \uc5ec\ud589\uc744 \uac00\ubcf4\uc138\uc694."],s))
m.push(A.a(["\ud788\uc988\ube48\uc2a4 \uc74c\ub8cc\ub97c \uacc1\ub4e4\uc5ec \uc0c8\ub0b4\uae30\ub4e4\uacfc \ubc24\uc0b0\ucc45\uc744 \ud558\uba74\uc11c \uacc1\uc744 \uc9c0\ucf1c\uc8fc\ub294 \uac74 \uc5b4\ub5a4\uac00\uc694?"],s))
m.push(A.a(["\uc0c8\ub0b4\uae30\uc758 \uccab \uc2dc\uac04\ud45c \uad6c\uc131\uc774\ub098 \uc804\uacf5 \uc120\ud0dd \ub4f1 \ucc98\uc74c \ub9de\uc774\ud558\ub294 \uc0c1\ud669\uc5d0\uc11c \ubc29\ud5a5\uc744 \uc7a1\uc544 \uc904 \uc218 \uc788\uc5b4\uc694."],s))
m.push(A.a(["\ubaa8\ub450\uac00 \ud568\uaed8 \ud560 \uc218 \uc788\ub294 \ud65c\ub3d9\ub3c4 \uc88b\uc9c0\ub9cc, \uc18c\uc678\ub418\ub294 \uc0ac\ub78c\uc774 \uc0dd\uae30\uc9c0 \uc54a\ub294 3~4\uc778 \ub2e8\uc704\uc758 \ud65c\ub3d9\ub4e4\ub3c4 \ucd94\ucc9c\ud574\uc694. (e.g. \ubcfc\ub9c1, \ubc29\ud0c8\ucd9c \ub4f1)"],s))
l.push(A.a(["\uc138\uc12c \ud30c\ud2b8\ub108\uc640 \uac08\ub4f1 \uc0c1\ud669\uc774 \uc0dd\uae38\ub54c, \ud68c\ud53c\ud574\uc11c \ub354 \ud070 \uac08\ub4f1\uc744 \ubd88\ub7ec \uc77c\uc73c\ud0ac \uc218 \uc788\uc5b4\uc694","\uc0c8\ub0b4\uae30\ub098 \uc0c8\uc12c\ud30c\ud2b8\ub108\uc640\uc758 \uad00\uacc4\uc5d0 \uc788\uc5b4 \ucd08\ubc18\uc5d0 \ud798\uc744 \ub108\ubb34 \ub9ce\uc774 \uc8fc\uba74, \ub4a4\uc5d0 \uac14\uc744 \ub54c \uc9c0\uce60 \uc218 \uc788\uc5b4\uc694"],s))
