l.push(A.a(["\uc0ac\ub78c\uc744 \uc774\ud574\ud558\ub824\ub294 \uc131\ud5a5\uc774 \uac15\ud55c \ud0c0\uc785\uc774\uc5d0\uc694. \uadf8\ub798\uc11c \ub204\uad70\uac00 \uace0\ubbfc\uc774 \uc788\uc744 \ub54c, \uacbd\uccad\uacfc \uc9c8\ubb38\uc5d0 \uc9d1\uc911\ud558\uc5ec\uc11c \uc2dc\uc6d0\ud55c \uc815\ub2f5\uc744 \uc6d0\ud558\ub294 \uc0ac\ub78c\uc5d0\uac8c\ub294 \ub2f5\ub2f5\ud558\uac8c \ubcf4\uc77c \uc218 \uc788\uc5b4\uc694.","\ud568\uaed8 \ud558\uae30\ub97c \uc911\uc694\ud558\uac8c \uc0dd\uac01\ud574\uc11c, \uc0ac\ub78c\ub4e4\uc744 \uc774\ub04c\uc5b4\uc57c \ud558\ub294 \uc0c1\ud669\uc5d0\uc11c \ub2f5\ub2f5\ud574 \ubcf4\uc77c \uc218 \uc788\uc5b4\uc694.","\uc560\uc815\uc774 \ub9ce\uc740 \ud0c0\uc785\uc774\uc5b4\uc11c \uc790\uc2e0\ubcf4\ub2e4\ub294 \ub0a8\uc744 \ucc59\uae30\ub294 \uacbd\uc6b0\uac00 \uc788\uc5b4\uc694."],s))
k.push(A.a(["\uac08\ub4f1 \uc0c1\ud669\uc744 \ub9c8\uc8fc\ud558\ub294 \uac8c \uc5b4\ub835\uc9c0\ub9cc, \ub300\ud654\ub97c \ud1b5\ud574 \ud480\uc5b4\ubcf8\ub2e4\uba74 \uc774\uc804\ubcf4\ub2e4 \ub354 \ub048\ub048\ud558\uace0 \uc88b\uc740 \uad00\uacc4\ub97c \uc720\uc9c0\ud560 \uc218 \uc788\uc744 \uac70\uc5d0\uc694","\uc0ac\ub78c\ub9c8\ub2e4 \uad00\uacc4\uc5d0 \ub300\ud55c \uc815\ub3c4\uac00 \ub2e4\ub97c \uc218 \uc788\ub2e4\ub294 \uac83\uc744 \uc778\uc9c0\ud558\uace0 \uc788\uc73c\uba70, \uad00\uacc4\uc5d0 \uc788\uc5b4 \ub35c \uc0c1\ucc98\ubc1b\uace0 \ud798\ub4e4\uc5b4\ud560 \uc218 \uc788\uc744 \uac70\uc5d0\uc694. \ud558\uc9c0\ub9cc \ub204\uad70\uac00\ub97c \ud5a5\ud55c \ub2f9\uc2e0\uc758 \uc0ac\ub791\uc774 \uc808\ub300 \ud2c0\ub9ac\uc9c0 \uc54a\ub2e4\ub294 \uac78 \uc78a\uc9c0\ub9c8\uc138\uc694:)"],s))
